import React, { Component } from 'react';
import Table from './../assets/Table';
import { Navbar, Nav, NavDropdown, Form,  FormControl, Button, InputGroup, Card} from 'react-bootstrap';

export class RenderStudents extends Component {

    state = {
        address: this.getDiplomaStorageAddress()
    }

    getDiplomaStorageAddress () {
        return this.props.match.params.address
      }

    constructor(props) {
        super(props);

        
        this.onSubmitRenderStudents = this.onSubmitRenderStudents.bind(this);
    }
    render() {
        return(
    
            <div className="App">
            <header>
              <Navbar expand="lg" variant="dark" bg="dark">
                <Navbar.Brand href="#home">Diploma Storage</Navbar.Brand>
                  <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                      <Nav className="m-auto">
                        <Nav.Link href="/" className ="text-white text-uppercase ml-5">Home</Nav.Link>
                        <Nav.Link href="https://react-bootstrap.netlify.app/components/button-group/" className ="text-white text-uppercase ml-5">Link</Nav.Link>
                        <NavDropdown title="Dropdown" id="basic-nav-dropdown" className ="text-white text-uppercase ml-5">
                          <NavDropdown.Item>Action</NavDropdown.Item>
                          <NavDropdown.Item>Another action</NavDropdown.Item>
                          <NavDropdown.Item>Something</NavDropdown.Item>
                          <NavDropdown.Divider />
                          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                      </NavDropdown>
                    </Nav>
                    <Form inline>
                      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                      <Button variant="outline-success">Search</Button>
                    </Form>
                </Navbar.Collapse>
              </Navbar>
            </header>
            
            <div>
            <Table/>
            </div>

        </div>
        );
    }

    onSubmitRenderStudents(event) {
        event.preventDefault();
         this.props.history.push(`/RenderStudents/${this.state.address}`)
    }
}

export default RenderStudents;
